function Cart(){
    const title = 'Panier';
    const monstreraPrice = 8;
    const lierrePrice = 10;
    const bouquetPrice = 15;
    return(
        <div className="cart">
            <h2 className="title-cart">{title.toUpperCase()}</h2>
            <ul className="ul-cart">
                <li>-Monstrera: {monstreraPrice}€</li>
                <li>-Lierre: {lierrePrice}€</li>
                <li>-Bouquet: {bouquetPrice}€</li>
            </ul>
            <h3 className="total-cart">Total price: {monstreraPrice + lierrePrice + bouquetPrice}€</h3>
        </div>
    )      
}

export default Cart
